local n_skins = 12 local texture_list_slim = {}
local texture_list_default = {
    ["scp_049"] = "",
    ["scp_173_8271915"] = "",
    ["scp_guard"] = "",
    ["scp_overlord_vaz_mtf_epsilon_6_village_idiots"] = "",
    ["skinTemplate"] = "",
    ["winter_clothing_soviet_soldier_13784932"] = "",
}
for i, v in pairs(texture_list_default) do
	mcl_skins.register_simple_skin({
        index = n_skins,
		texture = "blank.png^[png:" .. v,
	})
    n_skins = n_skins + 1
end
for i, v in pairs(texture_list_slim) do
    mcl_skins.register_simple_skin({
        index = n_skins,
        texture = "blank.png^[png:" .. v,
        slim_arms = true
    })
    n_skins = n_skins + 1
end
